import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Modal from 'react-bootstrap/Modal';

function CreateEvent() {
  const [showModal, setShowModal] = useState(false);
  const [materials, setMaterials] = useState(['']); // Initial state with one empty field

  const handleCloseModal = () => setShowModal(false);
  const handleShowModal = () => setShowModal(true);

  const handleMaterialChange = (index, value) => {
    const updatedMaterials = [...materials];
    updatedMaterials[index] = value;
    setMaterials(updatedMaterials);
  };

  const handleAddMaterialField = () => {
    setMaterials([...materials, '']);
  };

  const handleRemoveMaterialField = (index) => {
    const updatedMaterials = [...materials];
    updatedMaterials.splice(index, 1);
    setMaterials(updatedMaterials);
  };

  return (
    <>
      <Button variant="primary" onClick={handleShowModal}>
        Open Modal
      </Button>

      <Modal show={showModal} onHide={handleCloseModal}>
        <Modal.Header closeButton>
          <Modal.Title>Create Event</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <Form.Group className="mb-3">
              <Form.Label htmlFor="eventName">Event Name</Form.Label>
              <Form.Control id="eventName" placeholder="Event Name" disabled />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label htmlFor="participants">Number of Participants</Form.Label>
              <Form.Control id="participants" placeholder="Number of Participants" disabled />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label>Materials Required</Form.Label>
              {materials.map((material, index) => (
                <div key={index} className="d-flex mb-2">
                  <Form.Control
                    type="text"
                    value={material}
                    onChange={(e) => handleMaterialChange(index, e.target.value)}
                    placeholder="Material"
                    disabled
                  />
                  <Button variant="danger" className="ms-2" onClick={() => handleRemoveMaterialField(index)} disabled>
                    Remove
                  </Button>
                </div>
              ))}
              <Button variant="secondary" onClick={handleAddMaterialField} disabled>Add Material</Button>
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label htmlFor="estimatedCost">Estimated Cost</Form.Label>
              <Form.Control id="estimatedCost" placeholder="Estimated Cost" disabled />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label htmlFor="venue">Venue</Form.Label>
              <Form.Control id="venue" placeholder="Venue" disabled />
            </Form.Group>
            <Form.Group className="mb-3">
              <Form.Label htmlFor="time">Time</Form.Label>
              <Form.Control id="time" placeholder="Time" disabled />
            </Form.Group>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleCloseModal}>
            Close
          </Button>
          <Button variant="primary" onClick={handleCloseModal}>
            Save Changes
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default CreateEvent;
